const data = _data.sort((a, b) => a.name.localeCompare(b.name));

let partnerSelected = data[Math.floor(Math.random() * data.length)];

let category = "books";

let guessName = undefined;
let counter = 0;

const categories = [
  {name: 'books', btn: '#books-btn'},
  {name: 'movies', btn: '#movies-btn'},
  {name: 'albums', btn: '#albums-btn'},
  {name: 'shows', btn: '#shows-btn'},
  {name: 'plans', btn: '#plans-btn'},
  {name: 'places', btn: '#places-btn'},
]

function showCategory(newCategory) {
  category = newCategory;
  activateCategoryButtonSelected(category);
  createImages(partnerSelected[category]);
}

// Game

function showGameSection() {
  const gamesSection = document.getElementById('guess-container-id');
  const mainSection = document.getElementById('main-container');
  gamesSection.style.display = 'flex';
  mainSection.style.display = 'none';

  // populate select with id select-category-id with names in _data
  const select = document.getElementById('select-category-id');
  data.forEach((person) => {
    const option = document.createElement('option');
    option.textContent = person.name;
    option.value = person.name;
    select.appendChild(option);
  });

  generateGuess();

  return select;
}

function closeGameSection() {
  const gamesSection = document.getElementById('guess-container-id');
  const mainSection = document.getElementById('main-container');
  gamesSection.style.display = 'none';
  mainSection.style.display = 'flex';
  counter = 0;
  updateCounter();
}

function generateGuess() {
  // Get random image from _data constant
  const randomPerson = data[Math.floor(Math.random() * data.length)];
  const containerImg = document.getElementById('image-game-id');
  containerImg.innerHTML = '';
  let allRecs = allPartnersRecs(randomPerson);
  const randomElement = allRecs[Math.floor(Math.random() * allRecs.length)];
  const img = createImage(randomElement);
  guessName = randomElement.title;
  containerImg.appendChild(img);
}

function guess() {
  const selectedPartnerName = document.getElementById('select-category-id').value;
  const partner = data.find(partner => partner.name === selectedPartnerName);
  let allRecs = allPartnersRecs(partner);
  const isCorrect = allRecs.some(rec => rec.title === guessName);
  if (isCorrect) {
    generateGuess();
    counter += 1;
  } else {
    alert('Incorrecto');
    counter = 0;
  }
  updateCounter();
}

function updateCounter() {
  const counterElement = document.getElementById('counter-id');
  counterElement.textContent = 'Contador:' + counter;
}

function allPartnersRecs(partner) {
  let allRecs = [];
  for (const key in partner) {
    if (key === 'name') {
      continue;
    }
    if (categories.map(cat => cat.name).includes(key)) {
      allRecs = allRecs.concat(partner[key]);
    }
  }
  return allRecs;
}

function activateCategoryButtonSelected(category) {
  categories.forEach(cat => {
    const categoryBtn = document.getElementById(cat.btn);
    if (cat.name === category) {
      categoryBtn.classList.add('active');
    } else {
      categoryBtn.classList.remove('active');
    }
  });
}

function createSelect() {
  const select = document.getElementById('select-partner');
  data.forEach((partner) => {
    const option = document.createElement('button');
    option.textContent = partner.name;
    option.value = partner.name;
    option.onclick = () => {
      changeNameSelected(partner.name);
      highlightSelected(partner.name);
      createImages(partner[category]);
      partnerSelected = partner;
    }
    select.appendChild(option);
  });
  return select;
}

function highlightSelected(name) {
  const buttons = document.querySelectorAll('#select-partner button');
  buttons.forEach((button) => {
    if (button.textContent === name) {
      button.className = 'partner-selected';
    } else {
      button.className = '';
    }
  });
}

function createElementImage(book) {
  const img = document.createElement('img');
  img.src = book.image;
  img.className = category === 'albums' || category === 'plans' || category === 'places' ? 'image-album' : 'image';
  const aTag = document.createElement('a');
  aTag.href = book.link;
  aTag.target = '_blank';
  aTag.appendChild(img);
  return aTag;
}

function createImages(images) {
  const imagesContainer = document.getElementById('images-container');
  if (images) {
    imagesContainer.innerHTML = '';
    images.forEach((imagePath) => {
      const newDiv = createImage(imagePath);
      imagesContainer.appendChild(newDiv);
    });
  } else {
    imagesContainer.innerHTML = "No hay recomendaciones";
  }
  return imagesContainer;
}

function createImage(imagePath) {
  const newDiv = document.createElement('div');
  newDiv.appendChild(createElementImage(imagePath));
  newDiv.appendChild(createElementTitle(imagePath.title));
  newDiv.appendChild(createElementWriter(imagePath.writer));
  return newDiv;
}

function nextRecomendation() {
  const partners = data.map(partner => partner.name);
  const index = partners.indexOf(partnerSelected.name);
  partnerSelected = data[(index + 1) % data.length];
  changeNameSelected(partnerSelected.name);
  highlightSelected(partnerSelected.name);
  createImages(partnerSelected[category]);
}

function previousRecomendation() {
  const partners = data.map(partner => partner.name);
  const index = partners.indexOf(partnerSelected.name);
  partnerSelected = data[(index - 1 + data.length) % data.length];
  changeNameSelected(partnerSelected.name);
  highlightSelected(partnerSelected.name);
  createImages(partnerSelected[category]);
}

function createElementTitle(title) {
  const titleDiv = document.createElement('h3');
  titleDiv.textContent = title;
  titleDiv.className = 'element-title';
  return titleDiv;
}

function createElementWriter(writer) {
  const writerDiv = document.createElement('h4');
  writerDiv.textContent = writer;
  writerDiv.className = 'element-writer';
  return writerDiv;
}

function generateInitialContent() {
  createSelect();
  changeNameSelected(partnerSelected.name);
  createImages(partnerSelected[category]);
  highlightSelected(partnerSelected.name);
  const bookBtn = document.getElementById('#books-btn');
  bookBtn.classList.add('active');
}

function changeNameSelected(name) {
  const nameSelected = document.getElementById('name-selected');
  nameSelected.innerHTML = name
}

function openMenu() {
  const rightSection = document.getElementById("right-container");
  const leftSection = document.getElementById("left-container");
  rightSection.className = "right-open ";
  leftSection.style.display = 'none';
}

document.addEventListener('keydown', (event) => {
  if (event.key === 'ArrowRight') {
    nextRecomendation();
  }
  if (event.key === 'ArrowLeft') {
    previousRecomendation();
  }
});

generateInitialContent();